import React from "react";

const About = () => {
  return (
    <section id="tentang" className="px-6 py-16 text-center bg-gray-100">
      <h2 className="text-3xl font-bold" data-aos="fade-up">Tentang ROI</h2>
      <p className="max-w-2xl mx-auto mt-4 text-gray-700" data-aos="fade-up">
        Return on Investment (ROI) adalah metrik yang digunakan untuk mengevaluasi efisiensi investasi...
      </p>
    </section>
  );
};

export default About;
